// Login.js

import React from 'react';
import Navbar from '../components/Navbar'; // Asegúrate de tener la ruta correcta al componente Navbar
import Footer from '../components/Footer'; // Asegúrate de tener la ruta correcta al componente Footer
import Login from '../components/Login'; // Asegúrate de tener la ruta correcta al componente Login

function LoginRoute() {
  const handleLogin = (username, password) => {
    // Aquí puedes manejar la lógica de autenticación si es necesario
    // Por ejemplo, podrías enviar una solicitud al servidor para verificar las credenciales
    console.log('Login credentials:', username, password);
  };

  return (
    <>
      <Navbar />
      <Hero 
        cName="hero"
        heroImg="https://i.postimg.cc/85tH18kv/marten-bjork-n-IKQDCyr-G0-unsplash.jpg"
        title="Reserva con confianza, descansa con tranquilidad"
        text="Encontra tu alojamiento ideal"
        buttonText="Reserva"
        url="/Hoteles"
        btnClass="show"
        />
      <Login onLogin={handleLogin} />
      <Footer />
    </>
  );
}

export default LoginRoute;
